I heard someone say this in a podcast the other day and i thought it was so powerful. People on here often talk about how we shouldn‚Äôt compare ourselves to other people because everything is just a highlight reel. But is the portrayal of our own highlight reel affecting us just as much?

Psychologically our identities are so important to us. Our identity gives us a sense of self and in a way, a blueprint on how we think we should show up in our lives. Our identities are often defined by our jobs, our relationships, the way we look, how much money we make etc. If we overly identify, it could lead us to think we need to perfectly embody whatever role that may be, whether it be good or bad. This can cause us to act in ways that don‚Äôt really represent who we are.

I think it‚Äôs important to check in often and ask yourself why you‚Äôre living out a certain role and if that truly aligns with who you want to be. Is the identity you‚Äôre portraying authentic or driven by ego? Where does your identity come from? Have you even thought about your identity? And why does it matter to you?

